एक ही समय में अपने वीडियो देखना और इंटरनेट ब्राउज़ करना चाहते हैं? {{}

जब आप वीडियो देख रहे हैं तो चित्र मोड में चित्र का उपयोग करना चाहते हैं? {२}

इस एक्सटेंशन का लक्ष्य आपको इंटरनेट पर सर्फ करने और एक ही समय में वीडियो देखने की अनुमति देता है। इस सॉफ्टवेयर का उपयोग शुरू करने के लिए, बस
एक्सटेंशन आइकन पर क्लिक करें जब आप एक वेबसाइट पर होते हैं जिसमें एक वीडियो होता है। वीडियो पॉप आउट होना चाहिए और एक छोटी विंडो में होना चाहिए, यह आपको अनुमति देता है
जब आप वीडियो देख रहे हों तो इस वेबपेज से दूर जाएं। यह आज की कोशिश करो, वीडियो देखने के लिए इसकी एक त्वरित और आसान विधि। {{}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। पिक्चर इन पिक्चर स्वामित्व में नहीं है, इसके द्वारा लाइसेंस प्राप्त नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
